import React from 'react'
import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <div>
      <h1>Home组件内容</h1>
      <h3>
        <Link to="news">News</Link>
      </h3>
      <h3>
        <Link to="message">Message</Link>
      </h3>
    </div>
  )
}
